pragma solidity >=0.7.0 <0.9.0;

contract PlonkVerifier {

    uint32 constant n =   128;
    uint16 constant nPublic =  1;
    uint16 constant nLagrange = 1;

    uint256 constant Qmx = 12399307814489295754096363478609317645516143751912218987493473393571727340994;
    uint256 constant Qmy = 18349026411608973172054058340869032321169240649103917981399571268283027814096;
    uint256 constant Qlx = 5477284379764910969337660467620805582724460174271006951751579950743799217426;
